INSERT INTO NFL_CONTRACT (CONTRACT_SALARY, CONTRACT_YEAR, TEAM_ID, PERSON_ID, PERSON_NUMBER)
	VALUES (0, "2012", 
		(SELECT TEAM_ID
		 FROM NFL_TEAM
		 WHERE TEAM_NAME = "Cardinals"),
		(SELECT PERSON_ID
		 FROM NFL_PERSON
