		(SELECT POSITION_ID
		 FROM NFL_POSITION
		 WHERE POSITION_ABBR = "S"),
		(SELECT CONTRACT_ID
		 FROM NFL_CONTRACT
		 WHERE TEAM_ID = 
			(SELECT TEAM_ID
			 FROM NFL_TEAM
			 WHERE TEAM_NAME = "Raiders")
		 AND PERSON_ID =  
			(SELECT PERSON_ID
			 FROM NFL_PERSON
			 WHERE PERSON_FIRST_NAME = "matt"
				AND PERSON_HEIGHT = 71
				AND PERSON_WEIGHT = 204
				AND PERSON_LAST_NAME = "giordano")));

